Chung cư mini Vĩnh Phúc được xây dựng trên nền đất vuông vắn rộng hơn 250 m có quy mô gồm 7 tầng căn hộ . Mỗi tầng có 5 căn hộ với hệ thống gồm 1 thang bộ và 1 thang máy hiện đại tốc độ cao . 
 Tòa nhà thiết kế tầng 1 để xe , tầng trên cùng là tầng tum sân phơi chung còn lại là các tầng căn hộ . Có đầy đủ hệ thống PCCC , an ninh tòa nhà bảo vệ chuyên nghiệp 24 / 24 , . . . . 
 - CH số 1 : DT 48 m 2 gồm 2 PN , PKB , 2 WC , BC mặt trước giá : 980 tr ; 
 - CH số 2 : DT 21 - 24 m 2 gồm 1 PN , PKB , 1 WC , BC mặt trước giá : 420 - 470 tr ; 
